import React, {useState, useEffect} from "react";
import styled from 'styled-components'

function Search(props) {

  const {} = props;

  const [value, setValue] = useState()

  return (
      <Container>
        <input type='text'
               onChange={(e)=>{
            setValue(e.target.value)

        }}
            onKeyPress={(e)=>{
                if(e.key === 'Enter'){
                    console.log(value)


                }
            }}

        />
      </Container>
  )

}

const Container = styled.div`

`;

export default Search;
